import React from "react";

import { EuiCard, EuiFlexItem, EuiText } from "@elastic/eui";

const Card = (props) => (
  <EuiFlexItem>
    <EuiCard
      style={{ width: "18rem" }}
      textAlign="left"
      image={
        <div>
          <img src={props.item.media.standard[0].url} alt="" />
        </div>
      }
      title={
        <EuiText>
          <h2>{props.item.name}</h2>
        </EuiText>
      }
      description={props.item.price.offer_price.value}
    />
  </EuiFlexItem>
);

export default Card;
